from typing import Optional
from typing import List
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next
def build_linked_list(l:List)->Optional[ListNode]:
    if len(l)==0:
        return
    node=ListNode(l[0])
    cur_node=node
    for i in l[1:]:
        cur_node.next=ListNode(i)
        cur_node=cur_node.next
    return node


class Solution:
    def build_linked_list(self,l:List)->Optional[ListNode]:
        if len(l)==0:
            return
        node=ListNode(l[0])
        cur_node=node
        for i in l[1:]:
            cur_node.next=ListNode(i)
            cur_node=cur_node.next
        return node
    def sortList(self, head: Optional[ListNode]) -> Optional[ListNode]:
        counter=[]
        cur_ele=head
        while cur_ele!=None:
            counter.append(cur_ele.val)
            cur_ele=cur_ele.next
        counter.sort()
        return self.build_linked_list(counter)
